n        // }\n        // console.log(b);\n \n         //在一个大括号中 使用let关键字声明的变量才具有块级作用域 var关键字是不具备这个特点的\n        // if(true)\n        // {\n        //     var abc = 'abc';\n        //     let num = 'num';\n        // }\n        // console.log(abc);\n        // console.log(num);\n \n        // 防止循环变量变成全局变量\n        // for(let i =0;i<2;i++)\n        // {\n \n        // }\n        // console.log(i);\n \n        //不存在变量提升\n        //使用let关键字声明的变量没有变量提升\n        // console.log(a);\n        // let a = 20;\n \n        //使用let关键字声明的变量具有暂时性死区特性\n        var num = 10;\n        if(true)\n        {\n            console.log(num);\n            let num = 203;\n        }\n    <\/script>\n</body>\n</html>\n\n2.经典面试题\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\">\n    <title>2.经典面试题</title>\n</head>\n<body>\n    <script>\n    //var\n    var arr = [];\n    for(var i =0;i<2;i++)\n    {\n        arr[i] = function(){\n            console.log(i);\n        }\n    }\n    arr[0]();\n    arr[1]();\n \n    //let\n    for(let i =0;i<2;i++)\n    {\n        arr[i] = function(){\n            console.log(i);\n        }\n    }\n    arr[0]();\n    arr[1]();\n    <\/script>\n</body>\n</html>\n3.const关键字\n作用：声明常量，常量就是值(内存地址) 不能变化的量\n\n1.具有块级作用域\n\nif (true) {\n\tconst a = 10;\n}\nconsole.log(a); // a is not defined\n2.声明常量时必须赋值\n\nconst PI; // Missing initializer in const declaration\n\n3.常量赋值后，值不能修改\n\n//常量声明后值不可更改\nconst PI = 3.14;\nPI = 100; // assignment to constant variable.   \n \nconst ary = [100, 200];\nary[0] = 'a';\nary[1] = 'b';\nconsole.log(ary); // ['a', 'b'];\nary = ['a','b']; // assignment to constant variable.   \n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\">\n    <title>3.const关键字</title>\n</head>\n<body>\n    <script type=\"text/javascript\">\n        //使用const关键字声明的变量具有块级作用域\n        // if(true)\n        // {\n        //     const a =10;\n        //     if(true)\n        //     {\n        //         const a = 20;\n        //         console.log(a);\n        //     }\n        //     console.log(a);\n        // }\n        // console.log(a);\n        \n        //使用const关键字声明的变量必须赋初始值\n        // const PI = 3.14;\n \n        //常量声明后值不可更改\n        const PI = 3.14;\n        PI = 100; // assignment to constant variable.   \n \n        const ary = [100, 200];\n        ary[0] = 'a';\n        ary[1] = 'b';\n        console.log(ary); // ['a', 'b'];\n        ary = ['a','b']; // assignment to constant variable.   \n    <\/script>\n</body>\n</html>\n4.let、const、var关键字的区别\n使用var声明的变量，其作用域为该语句所在的函数内，且存在变量提升现象。\n使用let声明的变量，其作用域为该语句所在的代码块内，不存在变量提升。\n使用 const 声明的常量，在后面出现的代码中不能修改该常量的值。\n\n 5.数据解构\nES6 中允许从数值中提取值，按照对应位置，对变量赋值。对象也可以实现解构。\n\n let [a, b, c] = [1, 2, 3];\nconsole.log(a);\nconsole.log(b);\nconsole.log(c);    \n// 如果解构不成功，变量的值为undefined \nlet [foo] = []; //undefined \nlet [bar, foo] = [1];   //undefined \nlet ary = [1,2,3];\nlet[a,b,c,d,e] = ary;\nconsole.log(d);//undefined \nconsole.log(e);//undefined \n\n6.对象解构\n//对象解构允许我们使用变量的名字匹配对象的属性 匹配成功将对象属性的值赋值给变量\nlet person = { name: 'zhangsan', age: 20 }; \nlet { name, age } = person;\nconsole.log(name); // 'zhangsan'\nconsole.log(age); // 20    \n          \nlet {name: myName, age: myAge} = person; // myName myAge 属性别名\nconsole.log(myName); // 'zhangsan' \nconsole.log(myAge); // 20 \n\n7.箭头函数\nES6中新增的定义函数的方法。\n\n() => {}    \nconst fn = () => {}\n 函数体中只有一句代码，且代码的执行结果就是返回值，可以省略大括号\n\nfunction sum(num1, num2) {\n    return num1 + num2;\n}    \nconst sum = (n1,n2)=>{return n1+n2;}\nconst sum = (num1, num2) => num1 + num2;//省略大括号\n如果形参只有一个，可以省略小括号\n\nfunction fn(v){\n    retuen v;\n} \nconst fn = v => v;\n\n7.箭头函数中的this关键字\n箭头函数不绑定this关键字，箭头函数中的this，指向的是函数定义位置的上下文this。\n\nfunction fn(){\n    console.log(this);\n    return ()=>{\n        console.log(this);\n    }\n}\nconst obj = {name:'wangwu'};\nconst resFn = fn.call(obj);\nresFn();\n\n8.箭头函数面试题\n<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\">\n    <title>7.箭头函数面试题</title>\n</head>\n<body>\n    <script type=\"text/javascript\">\n    var age = 200;\n    var obj={\n        age:20,\n        say:()=>{\n            console.log(this.age);\n        }\n    }\n    obj.say();\n    <\/script>\n</body>\n</html>\n\n9.剩余参数\n剩余参数语法允许我们将一个不定数量的参数表示为一个数组。\n\nfunction sum (first, ...args) {\n    console.log(first); // 10 \n    console.log(args); // [20, 30]\n}\nsun(10, 20, 30);\n    const sum =(...args)=>{\n        let total = 0;\n        // args.forEach((item)=>{\n        //     total += item;\n        // })\n        //简写为\n        args.forEach(item=> total += item )\n        return total;\n    }\n   console.log(sum(10,20));\n   console.log(sum(10,20,30));\n10.剩余参数和解构配合使用\n    let ary1 = ['张三','李四','王五'];\n    // let [s1,...s2] = ary1;\n    let [s1,...s2] = ary1;\n    console.log(s1);// 张三\n    console.log(s2);// ['李四', '王五']\n11.扩展运算符\n扩展运算符可以将数组或者对象转为用逗号分隔的参数序列。\n\nlet aty = [1, 2, 3];\n// ...ary  // 1, 2, 3\nconsole.log(...ary);  // 1 2 3 \nconsole.log(1, 2, 3); // 1 2 3\nconsole.log(ary); //[1, 2, 3]\n \n12.扩展运算符应用：合并数组\n扩展运算符可以应用于合并数组。\n\n//方法一 \nlet ary1 = [1, 2, 3];\nlet ary2 = [3, 4, 5];\nlet ary3 = [...ary1, ...ary2];\n//...ary1 //1,2,3\n//...ary2 //4,5,6  \nconsole.log(ary3);\n// 方法二\nvar ary1 = [1,2,3];\nvar ary2 = [4,5,6];\nary1.push(...ary2);\nconsole.log(ary1);\n13.扩展运算符应用：将伪数组转换为真正的数组\nvar oDivs = document.getElementsByTagName('div');\nconsole.log(oDivs);\nvar ary = [...oDivs];\nary.push('a');\nconsole.log(ary);\n\n14.Array扩展方法：Array.from方法\n将类(伪)数组或可遍历对象转换为正真的数组\n\nvar arrylike = {\n    \"0\":\"张三\",\n    \"1\":\"李四\",\n    \"2\":\"王五\",\n    \"length\":3\n}\nconsole.log(arrylike);//{0: '张三', 1: '李四', 2: '王五', length: 3}\nvar ary = Array.from(arrylike);\nconsole.log(ary);//['张三', '李四', '王五']\n方法还可以接受第二个参数，作用类似于数组的map方法，用来对每个元素进行处理，将处理后的值放入返回的数组。\n\nvar arraylike = {\n    \"0\":\"1\",\n    \"1\":\"2\",\n    \"length\":2\n}\nvar ary = Array.from(arraylike,item=>item*2) // 2 4\nconsole.log(ary);\n15.Array实例方法：find\n用于找出第一符合条件的数组成员，如果没有找到返回undefined\n\nlet ary = [{\n    id: 1,\n    name: '张三' \n},{\n    id: 2,\n    name: '李四'\n}];\nlet target = ary.find((item, index) => item.id == 2);\nconsole.log(target);//{id: 2, name: '张三'}\n\n16.Array实例方法：findIndex\n用于找出第一个符合条件的数组成员的位置，如果没有找到返回-1\n\nlet  ary = [10,20,50];\nlet index = ary.findIndex(item => item> 15);\nconsole.log(index);//1\n\n17.Array实例方法：includes\n表示某个数组是否包含给定的值，返回布尔值\n\nlet ary = [\"a\",\"b\",\"c\"];\nlet result = ary.includes('a');\nconsole.log(result);//true\nresult = ary.includes('e');\nconsole.log(result);//false\n18.模板字符串\nES6 新增的创建字符串的方式，使用反引号定义。\n\nlet name = `zhangsan`;\n 特点1. 模板字符串中可以解析变量。\n\nlet name = '张三';\nlet sayHello = `hello,my name is ${name}`; // hello,my name is zhangsan \n 特点2. 模板字符串中可以换行\n\nlet resilt = {\n    name: 'zhangsan',\n    age: 20,\n    sex：'男'\n}\nlet html = ` <div>\n    <span>${result.name}</span>\n    <span>${result.name}</span>\n    <span>${result.name}</span>\n</div> `;\n特点3. 在模板字符串可以调用函数。\n\ncolst aryHello = function () {\n    return '哈哈哈哈 追不到我吧 我就是这么强大';\n};\nlet greet = `${sayHello()} 哈哈哈哈`;\nconsole.log(greet); // 哈哈哈哈 追不到我吧 我就是这么强大 哈哈哈哈 \n\n19.startsWith方法和endsWith方法\n实例方法：startsWith() 和 endsWith()\n\nstartsWith(): 表示参数字符串是否在原字符串的头部，返回布尔值\nendsWith(): 表示参数字符串是否在原字符串的尾巴，返回布尔值\nlet str = 'Hello ECMAScript 2015';\nlet r1 = str.startsWith('Hello');//true\nconsole.log(r1);\nlet r2 = str.endsWith('2016');//true\nconsole.log(r2);\n20.repeat方法介绍\nrepeat 方法表示将原字符串重复n次，返回一个新字符串。\n\nconsole.log('y'.repeat(5));//yyyyy\n\n21.创建set数据结构并利用set数据结构做数组去重\nES6 提供了新的数据结构 Set 它类似于数组 但是成员的值都是唯一的 没有重复的值\nSet本身是一个构造函数，用来生成 Set 数据结构。\n\nconst s = new Set;\n\nSet函数可以接受一个数组作为参数，用来初始化。\n\nconst set = new Set([1, 2 ,3 ,4 , 5]);\n\n    实例方法：\n        add(value): 添加某个值，返回Set结构本身\n        delete(value): 删除某个值，返回一个布尔值，表示删除是否成功\n        has(value): 返回一个布尔值，表示该值是否为Set的成员\n        clear(): 清除所有成员，没有返回值\n\nconst s1 = new Set();\nconsole.log(s1.size);// 0\nconst s2 = new Set([\"a\",\"b\"]);\nconsole.log(s2.size);// 2\nconst s3 = new Set([\"a\",\"a\",\"b\",\"b\"]);\nconsole.log(s3.size);// 2\nconst ary = [...s3];\nconsole.log(ary);//['a', 'b']\n\n22.set对象实例方法\nconst s = new Set();\ns.add(1).add(2).add(3);     // 向 set 结构中添加值\ns.delete(2)                 // 删除 set 结构中的2值\ns.has(1)                    // 表示 set 结构中是否有1这个值 返回布尔值 \ns.clear()                   // 清除 set 结构中的所有值                     \nconst s4 = new Set();\n//向set结构中添加值 使用add方法\ns4.add('a').add('b');\nconsole.log(s4.size);//2\n//从set结构中删除值，用到的方法是delete\nconst r1 = s4.delete('a');\nconsole.log(s4.size);//1\nconsole.log(r1);//true\n//判断某一个值是否是set数据中的成员 使用has\nconst r2 = s4.has('b');\nconsole.log(r2);//true\n//清空set数据结构中的值 使用clear方法\ns4.clear();\nconsole.log(s4.size);//0\n\n 23.遍历set\nSet 结构的实例与数组一样，也拥有forEach方法，用于对每个成员执行某种操作，没有返回值\n\nconst s5 = new Set (['a','b','c','d','e']);\ns5.forEach((value)=>{\n    console.log(value);\n})\n")])]),n._v(" "),a("div",{staticClass:"line-numbers-wrapper"},[a("span",{staticClass:"line-number"},[n._v("1")]),a("br"),a("span",{staticClass:"line-number"},[n._v("2")]),a("br"),a("span",{staticClass:"line-number"},[n._v("3")]),a("br"),a("span",{staticClass:"line-number"},[n._v("4")]),a("br"),a("span",{staticClass:"line-number"},[n._v("5")]),a("br"),a("span",{staticClass:"line-number"},[n._v("6")]),a("br"),a("span",{staticClass:"line-number"},[n._v("7")]),a("br"),a("span",{staticClass:"line-number"},[n._v("8")]),a("br"),a("span",{staticClass:"line-number"},[n._v("9")]),a("br"),a("span",{staticClass:"line-number"},[n._v("10")]),a("br"),a("span",{staticClass:"line-number"},[n._v("11")]),a("br"),a("span",{static